import React from 'react';
import './App.css';
import bottleImage from './src/img/img1.jpeg'; // Replace with the actual image path

function App() {
  return (
    <div className="App">
      {/* Header Section */}
      <header className="header">
        <div className="logo">TUPPERWARE</div>
        <nav className="nav">
          <a href="#home">Home</a>
          <a href="#about">About Us</a>
          <a href="#pricing">Pricing</a>
          <a href="#contact">Contact Us</a>
        </nav>
      </header>

      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>BOTTLE<br />WHICH<br /><span className="highlight">NEEDED</span><br />EVERYDAY.</h1>
          <p>
            Tupperware water bottle is not just a water bottle, it's BPA-free & drinking more water every day can make a huge impact on your health.
          </p>
          <button className="cta-button">BUY NOW</button>
        </div>
        <div className="hero-image">
          <img src={bottleImage} alt="Drypp Smart Bottle" />
        </div>
      </section>
    </div>
  );
}

export default App;
